// This code only work on BOLTs and later (Due to requiring the light sensor!)
// Inspired by SolutionsincTV's code: https://www.youtube.com/watch?v=x24WSwoepxs
// MontyMango 2023 - Changed animations, adjusted light sensitivity, and added a 2 minute timer for competitions.
// MontyMango 2024 - Adjusted pitch, changed animations (again), and changed text when the two minute timer finishes
// Find block code here: https://edu.sphero.com/program/17033273

var new_dis = 0;


async function onCollision() {
	playMatrixAnimation(0, true);
}
registerEvent(EventType.onCollision, onCollision);

async function startProgram() {
	await delay(0.05);
	while (!(getElapsedTime() >= 120)) {
		if (getAmbientLight() > 40) {
			playMatrixAnimation(1, false);
			await roll(getRandomInt(0, 360), getRandomInt(100, 200), getRandomFloat(1, 1.5));
			if (getGyroscope().pitch >= 60 || getGyroscope().pitch <= -60) {
				playMatrixAnimation(2, true);
				await spin(180, 1);
				await roll(0, 70, 1);
			}
		} else {
			playMatrixAnimation(3, true);
			setSpeed(0);
		}
		await delay(0.025);
	}
	await scrollMatrixText('Iâ€™m out', { r: 213, g: 255, b: 248 }, 5, false);
	playMatrixAnimation(2, true);
}

